import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Welcome to developers Q/A Community!</h1>
      <p>Feel free to help or get help for/from community members!</p>
        <nav>
            <li>One</li>
            <li>two</li>
            <li>three</li>
        </nav>
    </div>
  );
}

export default App;
